import React,{lazy} from "react";
const Main=lazy(()=>import ('./elementos/main'));
import ".//app.css"

const Viewer=()=>{

    return(
        <div className="viewer">
        <h1></h1>
        </div>
    )
}
const App=()=>{

    return(
   
    <div className="app">
        <Viewer />
        
        <Main />
    </div>
    )
}
export default App
